export class Todo {
  TaskTitle: string;
  Description: string;
  Completed: boolean;

  constructor(TaskTitle: string, Description: string, Completed: boolean) {
    this.TaskTitle = TaskTitle;
    this.Description = Description;
    this.Completed = Completed;
  }
}
